function FilterYear(props) {
    const filteredArr = () => {
      var arrYear = [];
      props.detailDate.forEach(element => {
        if (!arrYear.includes(element)){
          arrYear.push(element.date.slice(0, 4));
        }
      }) 
      return arrYear;
    }

    console.log(filteredArr)
  return (
    <div
      style={{
        display: "flex",
        width: "93%",
        height: 50,
        fontSize: 20,
        margin: 20,
        justifyContent: "space-between",
        alignItems: "center",
      }}
    >
      <b
